description:
O aplicativo Indigo Neo permite registrar e gerenciar todas as suas necessidades de estacionamento:
- Inscreva-se e crie uma conta;
- Encontre o seu Estacionamento Indigo favorito;
- Use o aplicativo para ler o seu ticket de estacionamento e pagar. Chega de filas para pagamento!;
- Selecione um local e clique no endereço para obter rotas usando o mapa;
- Adicione veículos ou cartões de crédito a sua conta;
- Veja todas as suas atividades de estacionamento atuais, futuras ou passadas.
